DROP TABLE IF EXISTS `students`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `students` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT,
  `admission_no` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `student_fname` varchar(50) NOT NULL,
  `student_mname` varchar(50) NOT NULL,
  `student_lname` varchar(50) NOT NULL,
  `email_id` text,
  `mobile` bigint(20) DEFAULT NULL,
  `gender` varchar(1) NOT NULL,
  `is_active` int(11) NOT NULL DEFAULT '1',
  `parent_id` int(11) NOT NULL,
  `dob` date NOT NULL,
  `father_name` varchar(100) DEFAULT NULL,
  `mother_name` varchar(100) DEFAULT NULL,
  `joined_on` date NOT NULL,
  `leaving_date` date DEFAULT NULL,
  PRIMARY KEY (`student_id`),
  KEY `students_users` (`user_id`),
  KEY `students_parents` (`parent_id`),
  CONSTRAINT `students_users` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`),
  CONSTRAINT `students_parents` FOREIGN KEY (`parent_id`) REFERENCES `parents` (`parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=392 DEFAULT CHARSET=latin1;
